import React, { Component } from 'react'

class PieceComponent extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        const {symbol,selected} = this.props;
        return (
            <div class="container">
                {symbol}
                {selected &&<div class="box overlay"></div>}
            </div>
        )
    }
}

export default PieceComponent
